def olr_odom(actual_txt, our_txt):
    actual = np.loadtxt(actual_txt)
    xs_actual, ys_actual = zip(*actual)
    xs_odom, ys_odom = zip(*np.loadtxt(our_txt))
    plt.scatter(xs_actual, ys_actual, marker='.', label='Inferred pose')
    plt.scatter(xs_odom, ys_odom, marker='.', label='Odometry model')

    plt.title('Odometry model vs. inferred pose open loop')
    plt.axis('equal')
    legend = plt.legend(loc='upper left', frameon=True)
    legend.get_frame().set_facecolor('white')
    legend.get_frame().set_edgecolor('black')
    legend.get_frame().set_alpha(0.7)
    plt.show()

def olr_kine(actual_txt, our_txt, clip=False):
    actual = np.loadtxt(actual_txt)
    if clip:
        actual = [p for p in actual if p[1] > -16]
    xs_actual, ys_actual = zip(*actual)
    ours = np.loadtxt(our_txt)
    xs_odom, ys_odom = zip(*ours)

    plt.scatter(xs_actual, ys_actual, marker='.', label='Inferred pose')
    plt.scatter(xs_odom, ys_odom, marker='.', label='Kinematic model')

    plt.title('Kinematic model vs. inferred pose open loop')
    plt.axis('equal')
    legend = plt.legend(loc='upper left', frameon=True)
    legend.get_frame().set_facecolor('white')
    legend.get_frame().set_edgecolor('black')
    legend.get_frame().set_alpha(0.7)
    plt.show()

