def mse_vs_time():
    counts=[800,4000,1600,8000]
    for count in counts:
        with open('{}-particle-loop.txt'.format(count)) as f:
            xs, ys = f.read().split('\n')[2:4]
            xs = np.array([float(i) for i in xs[1:-1].split(',')])
            ys = np.array([float(i) for i in ys[1:-1].split(',')])
            xs -= xs[0]
            indices=np.where(xs > 5)
            xs = xs[indices]
            ys = ys[indices]
        plt.plot(xs, ys, label='{} particles'.format(count))

    plt.title('MSE over time')
    plt.xlabel('Time (seconds)')
    plt.ylabel('Mean squared error')
    legend = plt.legend(loc='upper left', frameon=True)
    legend.get_frame().set_facecolor('white')
    legend.get_frame().set_edgecolor('black')
    legend.get_frame().set_alpha(0.7)
    plt.show()

def particles_vs_time():
    counts = [200,800,1600,4000,8000]
    ys = []
    for count in counts:
        with open('time_loop_{}.txt'.format(count)) as f:
            text = f.read().split('\n')

        # xs = np.array([float(i) for i in text[1][1:-1].split(',')])[:100]
        times = np.array([float(i) for i in text[4][1:-1].split(',')])[:100]
        ys.append(np.mean(times))
    plt.plot(counts, ys, marker='o')
    plt.title('Particle filter computation time')
    plt.xlabel('Number of particles')
    plt.ylabel('Average computation time per iteration (seconds)')
    plt.show()

